import React, { Component } from "react";

import "./Header.css";

export default class Header extends Component {
  render() {
    return (
      <div>
        <div class="row">
          <div class="col-md-6 col-md-offset-3">
            <h1>(React) GOOGLE BOOKS</h1>
            <h2>Search and Save Books</h2>
          </div>
        </div>
      </div>
    );
  }
}
